bool
solve()
{
	order_t u;
	order_t order[MAX_N];
	int memo[MAX_N];
	int ix, ix2;

	memcpy(field, puzzle, sizeof(field));
	ix = 0;
	for (int i = 0; i < k; ++i)
		memo[ix++] = t[i];

	while (ix != 0)
	{
		ix2 = 0;
		for (int i = 0; i < ix; ++i)
		{
#ifdef DEBUG
			memset(&u, 0x00, sizeof(u));
#endif
			u.s = memo[i];
			u.rate = -100.0;
			probe(&u);
			if (u.rate != 100.0)
				order[ix2++] = u;
		}

		if (ix2 == 0)
			break;

		qsort(order, ix2, sizeof(order_t), cmp_func);
		if (order[0].rate == -100.0)
			return false;

		bury(&order[0]);

		ix = 0;
		for (int i = 1; i < ix2; ++i)
			memo[ix++] = order[i].s;
	}

	for (int y = 0; y < H; ++y)
	{
		for (int x = 0; x < W; ++x)
		{
			if (field[y][x] == '.')
				return false;
		}
	}

	return true;
}
